import React from 'react'
import '../App.css'
import './navbar.css'
import {NavbarData} from './NavbarData';


function Navbar() {
    return (
    <div className='Navbar'>
        <ul>
            {NavbarData.map((val,key) => {
            return (
            <li key={key} onClick ={() => {window.location.pathname = val.link}}>
                {""}
                <div>{val.icon}</div>  {""}
                <div>{val.title}</div>    
            </li>
            );
            })}
        </ul>
    </div>
    );
}
export default Navbar;
